description:
Verenigde Staten
Komedie
83 minuten

geregisseerd door Peter Segal
met Leslie Nielsen, Priscilla Presley en O.J. Simpson

Frank Drebin wordt uit zijn pensioen gehaald om undercover te gaan in een gevangenis. Daar moet hij uitzoeken wat de terrorist Rocco gepland heeft voor wanneer hij ontsnapt. Frank's vrouw Jane wil ondertussen graag een baby, wat Frank's problemen vergroot. Een grote hoeveelheid sterren worden tijdens de Oscar-uitreiking door Frank vernederd terwijl hij Rocco probeert te pakken.

